import './App.css';
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const getEmployeeList = (employees) => {
  const employeeList = employees.data.map(employee =>
    <ul>
      <li>
        <span className="employee-name">{employee.name}</span>
      </li>
      <li>
        <p>{employee.bio}</p>
      </li>
    </ul>
  )
  return employeeList
}

function App() {
  const [employees, setEmployees] = useState({ })

  useEffect(() => {
    axios.get('http://localhost:5000/employees').then(response => {
      setEmployees(response)
    }).catch(error => {
      console.log(error)
    })
  }, [])
  return (
    <div className="App">

      <div id="employee-list">
        {employees.status === 200 ?
          <div>
            <h2>Employee Listing</h2>
            {getEmployeeList(employees)}
          </div>
          :
          <h3>LOADING</h3>
        }
      </div>
    </div>
  );
}

export default App;
